### **Count Word Occurrences in a Text File**  

This C++ program reads a text file line by line and counts the number of occurrences of a specific word.  
**Requirements:**  
1. **Input:** A text file containing words.  
2. **Output:** The number of times the specified word appears in the file.  

#### **How It Works**  
1. **Read the Text File:**  
   - Open the text file using `ifstream`.
   - Read each line from the file.
2. **Count Word Occurrences:**  
   - Use a `std::string` variable to store the specified word.
   - Initialize a counter variable to 0.
   - Compare each line with the specified word.
   - Increment the counter for each match.
3. **Display the Result:**  
   - Print the final count.

#### **Code Explanation**  
1. **Include Necessary Libraries:**  
   - `fstream` for file input/output.
   - `string` for string manipulation.
2. **Define the Main Function:**  
   - Declare the `main()` function.
   - Define the specified word as a `std::string`.
   - Declare a counter variable to store the word count.
3. **Read the Text File:**  
   - Open the file using `ifstream`.
   - Read each line from the file.
4. **Count Word Occurrences:**  
   - Compare each line with the specified word.
   - Increment the counter for each match.
5. **Display the Result:**  
   - Print the final count.

#### **Code Implementation**  
```cpp
#include <fstream>  // For file input/output
#include <string>   // For string manipulation

int main() {
    // Define the specified word
    std::string word = "example";

    // Initialize the counter
    int count = 0;

    // Open the file
    std::ifstream file("text_file.txt");

    // Read each line from the file
    std::string line;
    while (std::getline(file, line)) {
        // Check if the line contains the specified word
        if (line.find(word) != std::string::npos) {
            // Increment the counter if the word is found
            count++;
        }
    }

    // Close the file
    file.close();

    // Display the result
    std::cout << "The word '" << word << "' appears " << count << " times." << std::endl;

    return 0;
}
```

#### **How to Use**  
1. **Specify the Word:**  
   - Replace `"example"` with the word you want to count.
2. **Specify the File Name:**  
   - Replace `"text_file.txt"` with the name of your text file.
3. **Run the Program:**  
   - Compile and run the program.
4. **Output:**  
   - The program will display the number of times the specified word appears in the text file.
